//import PageNotFound from './components/PageNotFound';

function App() {
  return (
    <div className="App">
      <Header/>
      <Router>
        {/* <Switch> */}
          {/* <Route exact path="/" component={Home} /> */}
          <Route exact path="/tree" component={Tree} />
          {/* <Route component={PageNotFound} /> */}
        {/* </Switch> */}
      </Router>
    </div>
  );
}
export default App;
